package com.smile.studio.network.ver2.model.Login;import com.google.gson.annotations.Expose;import com.google.gson.annotations.SerializedName;/** * Created by NhtlQuan on 5/2/2017. */public class ResponeUpdatePhone {    @SerializedName("code")    @Expose    private Integer code;    @SerializedName("message")    @Expose    private String messages = null;    @SerializedName("data")    @Expose    private Object data;    public Integer getCode() {        return code;    }    public void setCode(Integer code) {        this.code = code;    }    public String getMessages() {        return messages;    }    public void setMessages(String messages) {        this.messages = messages;    }    public Object getData() {        return data;    }    public void setData(Object data) {        this.data = data;    }}